import React, { useState } from "react";

const App = () => {

    let [num, setNum] = useState(0);

    const increment = () => {
        num ++;
        setNum(num); 
    }    

    return(
        <>
        <div className="container">
            <h1>{num}</h1>
            <button onClick={increment}>Increase</button>
        </div>
        </>
    );
}
export default App;
